(17, 'PACOTMACEIÓ – ALTA TEMPORADA ALAGOAS - BRASIL', 2, 'MACEIÓ –   ALAGOAS - BRASIL', '2017-11-15', '2017-11-17', 7, '500.00', 'Nome-do-Pacote-20171109162955.jpg', 'Nome-do-Pacote-20171109163000.jpg', 'V', 'V', 'Passagem Aérea Hospedagem Café da Manhã Wi-fi grátis Passagem Aérea Ho', 1, '<h2>ATEN&Ccedil;&Atilde;O&nbsp;</h2>\n\n<p>* A oferta inclui passagem a&eacute;rea da cidade de origem para Macei&oacute; e de Macei&oacute; para a cidade de origem; hospedagem em Macei&oacute; no Hotel Ciriba&iacute; ou similar (Com Caf&eacute; da Manh&atilde;);<br />\n* Dados do voo: Pacote v&aacute;lido exclusivamente para embarque e desembarque no aeroporto escolhido no momento da compra. Passagem a&eacute;rea calculada na classe econ&ocirc;mica, voando Tam, Gol, Avianca, Azul, podendo haver conex&otilde;es e /ou escalas. Hor&aacute;rios dos v&ocirc;os ser&atilde;o informados ap&oacute;s a pr&eacute;-reserva (dura&ccedil;&atilde;o de 24horas).<br />\n* Tipo de acomoda&ccedil;&atilde;o : Em apartamento Duplo<br />\nCheck-in a partir das 15h<br />\nCheck-out at&eacute; &agrave;s 11h</p>\n\n<h2><br />\n* Validade: 01/12/2017 a 28/02/2018&nbsp;</h2>\n\n<p>Conforme op&ccedil;&atilde;o de compra - O voucher n&atilde;o &eacute; v&aacute;lido para datas comemorativas e feriados nacionais, feriados prolongados, municipais, regionais e estaduais do Brasil e do lugar de destino. Sujeito a disponibilidade na data desejada.<br />\n* Oferta v&aacute;lida para 1 pessoa em acomoda&ccedil;&atilde;o dupla standard, sendo necess&aacute;rio adquirir 2 pacotes ou pagamento de suplemento para apartamento individual.<br />\n* Despesas extras n&atilde;o mencionadas n&atilde;o est&atilde;o inclusas no pacote, caso consumidas dever&atilde;o ser pagas localmente<br />\n* Consulte valores para hospedagem de crian&ccedil;as e pessoas extras diretamente com a Otur<br />\n* Para toda e qualquer altera&ccedil;&atilde;o ser&aacute; cobrado o valor de US$40,00 por pessoa, por altera&ccedil;&atilde;o, al&eacute;m de taxas aplicadas pelas empresas (Cia. a&eacute;rea e hotel)<br />\n* A documenta&ccedil;&atilde;o &eacute; de responsabilidade do passageiro.<br />\n* N&atilde;o ser&atilde;o aceitas trocas de nomes &nbsp;ap&oacute;s reservas efetuadas.<br />\n* Reservas n&atilde;o finalizadas em at&eacute; 48hs, caso necess&aacute;rio haver&aacute; reajuste de c&acirc;mbio.<br />\n* Para mais informa&ccedil;&otilde;es, ligue para 0300 3131 027 ou envie um e-mail&nbsp;&nbsp;<br />\n* &Agrave; vista ( Boleto ou dep&oacute;sito banc&aacute;rio) desconto de 5%.</p>', 'F'),
