(40, 'ISTAMBUL & CAPADÓCIA 10 DIAS - COM GUIA ACOMP', 30, 'ISTAMBUL & CAPADÓCIA 10 DIAS -TURQUIA', '2017-11-10', '2017-12-07', 8, '2008.00', 'ISTAMBUL-e-CAPADoCIA-10-DIAS---20171110140237.jpg', 'ISTAMBUL-e-CAPADoCIA-10-DIAS---20171110140242.jpg', 'V', 'V', 'Lorem ipsum dolor sit amet, consectetu', 1, '<p>Hospedagem em Istambul (Com caf&eacute; da manh&atilde;); hospedagem em Canakkale (Com caf&eacute; da manh&atilde; e jantar); hospedagem em Kusadasi (Com caf&eacute; da manh&atilde; e jantar); hospedagem em Pamukkale (Com caf&eacute; da manh&atilde; e jantar); hospedagem em Capad&oacute;cia (Com caf&eacute; da manh&atilde; e jantar); hospedagem em Ankara (Com caf&eacute; da manh&atilde; e jantar); Traslado de chegada e sa&iacute;da em Istambul; Guia acompanhante de Istambul a Istambul; Visitas indicadas no itiner&aacute;rio com entradas; Onibus ou Micro onibus turistico com ar condicionado; * todos os hoteis cat 4**** tipo Hotel Eresin Taxim em Istambul.<br />\n* Condi&ccedil;&otilde;es especiais para parte a&eacute;rea: Consulte-nos.<br />\n* Tipo de acomoda&ccedil;&atilde;o : Em apartamento Duplo ou Triplo<br />\nCheck-in a partir das 15h<br />\nCheck-out at&eacute; &agrave;s 11h<br />\n* Validade: Sa&iacute;das 11/01/2018 a 27/12/2018 - Conforme op&ccedil;&atilde;o de compra - O voucher n&atilde;o &eacute; v&aacute;lido para datas comemorativas e feriados nacionais, feriados prolongados, municipais, regionais e estaduais do Brasil e do lugar de destino. Sujeito a disponibilidade na data desejada.<br />\n* Oferta v&aacute;lida para 1 pessoa em acomoda&ccedil;&atilde;o dupla standard, sendo necess&aacute;rio adquirir 2 pacotes ou pagamento de suplemento para apartamento individual.<br />\n* Despesas extras n&atilde;o mencionadas n&atilde;o est&atilde;o inclusas no pacote, caso consumidas dever&atilde;o ser pagas localmente<br />\n* Consulte valores para hospedagem de crian&ccedil;as e pessoas extras diretamente com a Otur<br />\n* Para toda e qualquer altera&ccedil;&atilde;o ser&aacute; cobrado o valor de US$40,00 por pessoa, por altera&ccedil;&atilde;o, al&eacute;m de taxas aplicadas pelas empresas (Cia. a&eacute;rea e hotel)<br />\n* A documenta&ccedil;&atilde;o &eacute; de responsabilidade do passageiro.<br />\n* N&atilde;o ser&atilde;o aceitas trocas de nomes &nbsp;ap&oacute;s reservas efetuadas.<br />\n* Reservas n&atilde;o finalizadas em at&eacute; 48hs, caso necess&aacute;rio haver&aacute; reajuste de c&acirc;mbio.</p>', 'F'),
